create table Class (
	ClassID INT,
	Name VARCHAR(50),
	ProfID INT
);
create table Enrollment (
	EnrollmentID  INT,
	StudentID INT,
	ClassID INT
);
create table Prof (
	ID INT,
	FirstName VARCHAR(50),
	LastName VARCHAR(50),
	Phone VARCHAR(50)
);
create table Student (
	ID INT,
	FirstName VARCHAR(50),
	LastName VARCHAR(50),
	Email VARCHAR(50),
	Phone VARCHAR(50),
	Age INT
);
